  false,\n\t\"url\": null,\n\t\"notes\": \"The AFSC AGEDATA database is a collection
  of historic and ongoing fish ageing efforts by the Alaska Fisheries Science Center's
  Age and Growth Program from 1982 to present.  The database contains over 900,000
  observations of biological and collection data from survey and observer fish specimen
  collections spanning from 1976 to 2015.  Primarily the species aged are comprised
  of commercially important species of Alaska and the west coast such as walleye pollock,
  Pacific cod, rockfish, sablefish, and flatfish, although smaller numbers of other
  species are included as well such as skates, sculpins, and forage fish species.
  \ Specimen data includes fish age estimates, fish length, sex, weight, collection
  coordinates, date of collection, fish ageing methodologies, age reader information,
  and ageing structure descriptions.\",\n\t\"license_title\": null,\n\t\"extras\":
